import {BrowserRouter, Route, Switch} from 'react-router-dom';
import landingPage from './components/LandingPage';
//import Home from './components/home';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Switch>
        <Route exact path= '/' component ={landingPage}/>

      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
